import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (

      <div className = "App" class="cover-container d-flex w-100 h-100 p-3 mx-auto flex-column">
			  <header class="masthead mb-auto">
			    <div class="inner">
			      <h3 class="masthead-brand">P.C.I.</h3>
			      <nav class="nav nav-masthead justify-content-center">
			        <a class="nav-link active" href="#">Home</a>
			        <a class="nav-link" href="#">Features</a>
			        <a class="nav-link" href="#">Contact</a>
			      </nav>
			    </div>
			  </header>

			  <main role="main" class="inner cover">
			    <h1 class="cover-heading">Public Company Insights</h1>
			    <p class="lead">Enter your target company name below to gain insights. </p>
			    <p class="lead">
			      <a href="#" class="btn btn-lg btn-secondary">Learn more</a>
			    </p>
			  </main>

			  <footer class="mastfoot mt-auto">
			    <div class="inner">
			      <p>Path to Internship</p>
			    </div>
			  </footer>
			</div>
    );
  }
}

export default App;
